import React from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom'; 
import './App.css';
import Login from "./components/Login"; 
//import Logout from "./components/Logout"; 


function App() {
  return (
    <Routes>
      <Route exact path="/" element={<Login />} />

    </Routes>
  );
}

export default App;
